import React from 'react';

function TreeCounter({ count }) {
  return (
    <div className="tree-counter">
      <h1 style={{fontSize:'100px', fontWeight:'900'}}>{count} Trees Planted</h1>
    </div>
  );
}

export default TreeCounter;
